def maxProfit(k, prices):
    len_p = len(prices)
    if 2 * k > len_p:
        sum_p = 0
        for i in range(len_p - 1):
            if prices[i + 1] > prices[i]:
                sum_p += prices[i + 1] - prices[i]
        return sum_p
    else:
        res = [None] * (2 * k + 1)
        res[0] = 0
        for i in range(len_p):
            for j in range(min(2 * k, i + 1), 0, -1):
                res[j] = max(res[j], res[j - 1] + prices[i] * [1, -1][j % 2])
        return max(res)
