def rotate(nums, k):
    def reverse_list(nums,start,end):
        mid=(end-start)/2
        for i in range(mid+1):
            nums[start+i],nums[end-i]=nums[end-i],nums[start+i]
    len_n=len(nums)
    while k>len_n:
        k=k-len_n
    reverse_list(nums,0,len_n-k-1)
    reverse_list(nums,len_n-k,len_n-1)
    reverse_list(nums,0,len_n-1)
