def rob(nums):
    len_n = len(nums)
    if len_n == 0:
        return 0
    res = [0] * (len_n + 1)
    res[1] = nums[0]
    for i in range(2, len_n + 1, 1):
        res[i] = max(res[i - 1], res[i - 2] + nums[i - 1])
    return res[len_n]
class TreeNode(object):
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None

def rightSideView(root):
    """
    :type root: TreeNode
    :rtype: List[int]
    """
    res=[]
    if root == None:
        return res
    tmp_node=[root]
    while tmp_node:
        length=len(tmp_node)
        for i in range(length):
            tmp=tmp_node.pop(0)
            if i==0:
                res.append(tmp.val)
            if tmp.right:
                tmp_node.append(tmp.right)
            if tmp.left:
                tmp_node.append(tmp.left)
    return res
