def numIslands(grid):
    def change(grid,x,y):
        if (x<0) or (x>=len_row) or (y<0) or (y>=len_col):
            return
        else:
            if grid[x][y]=='1':
                grid[x][y]='0'
                change(grid,x-1,y)
                change(grid,x+1,y)
                change(grid,x,y-1)
                change(grid,x,y+1)
    num_island=0
    len_row=len(grid)
    if len_row==0:
        return num_island
    len_col=len(grid[0])
    if len_col==0:
        return num_island
    for row in range(len_row):
        for col in range(len_col):
            if grid[row][col]=='1':
                num_island+=1
                change(grid,row,col)
    return num_island
